import React, { Component } from 'react';
import { connect } from 'react-redux';
import './SelfDesign.scss';
import * as actions from '../../../store/actions';
import { FormattedMessage } from 'react-intl';
import Slider from "react-slick";

class SelfDesign extends Component {

    constructor(props) {
        super(props);
        this.state = {

        }
    }
    componentDidMount() {
        this.props.getSelfDesign();
    };

    componentDidUpdate() {

    };

    render() {
        console.log('check props: ', this.props.productsSelfDesign);
        return (
            <div className='section-share self-design-section'>
                <div className='section-container'>
                    <div className='section-header'>
                        <span className='title-section'>Bể tự thiết kế</span>
                        <button className='btn-section'>Xem thêm</button>
                    </div>
                    <div className='section-content'>
                        <Slider>
                            <div className='section-img'>
                                <div className='img self-design-section'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                        </Slider>
                    </div>
                </div>
            </div>
        );
    }

}

const mapStateToProps = state => {
    return {
        productsSelfDesign: state.product.productsSelfDesign
    };
};

const mapDispatchToProps = dispatch => {
    return {
        getSelfDesign: () => dispatch(actions.getSelfDesignStart())
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(SelfDesign);
